(1206, 'widget_ctup-ads-widget', 'a:10:{i:1;a:6:{s:5:"title";s:5:"Bodas";s:4:"text";s:208:"Sabemos que el día más importante para una pareja es la fecha de su matrimonio donde el sueño se vuelve realidad.\r\nEn Imagina Catering &amp; Eventos  nos encargamos hasta el mínimo detalle de tu evento.\r\n";s:4:"link";s:1:"#";s:9:"image_uri";s:68:"http://localhost/wordpress/wp-content/uploads/2018/12/matrimonio.jpg";s:15:"custom_media_id";s:3:"231";s:19:"image_in_customizer";s:75:"http://localhost/wordpress/wp-content/uploads/2018/12/matrimonio-99x150.jpg";}i:2;a:6:{s:5:"title";s:22:"Baby Shower y Bautizos";s:4:"text";s:156:" Animamos Baby Shower, aseguramos una diversión sana para todos tus invitados.\r\n\r\nTenemos diferentes paquetes que estarán al alcance de su presupuesto!!! ";s:4:"link";s:1:"#";s:9:"image_uri";s:62:"http://localhost/wordpress/wp-content/uploads/2018/12/baby.png";s:15:"custom_media_id";s:3:"242";s:19:"image_in_customizer";s:70:"http://localhost/wordpress/wp-content/uploads/2018/12/baby-150x150.png";}i:3;a:6:{s:5:"title";s:18:"Fiestas Especiales";s:4:"text";s:183:"Organizamos cualquier tipo de fiesta, entre ellos: fiesta de quinceaños, fiestas tematicas, fiesta de promoción, ceremonias de graduacion, fiestas de cumpleaños entre muchos otros.";s:4:"link";s:1:"#";s:9:"image_uri";s:65:"http://localhost/wordpress/wp-content/uploads/2018/12/fiesta2.jpg";s:15:"custom_media_id";s:3:"246";s:19:"image_in_customizer";s:73:"http://localhost/wordpress/wp-content/uploads/2018/12/fiesta2-150x100.jpg";}i:4;a:6:{s:5:"title";s:12:"Corporativos";s:4:"text";s:158:"El éxito de un evento empresarial se mide por el impacto que deja en los participantes, la calidad de atención brindada y calidad del servicio gastronómico";s:4:"link";s:1:"#";s:9:"image_uri";s:69:"http://localhost/wordpress/wp-content/uploads/2018/12/corporativo.jpg";s:15:"custom_media_id";s:3:"244";s:19:"image_in_customizer";s:77:"http://localhost/wordpress/wp-content/uploads/2018/12/corporativo-150x112.jpg";}s:12:"_multiwidget";i:1;i:6;a:6:{s:4:"text";s:0:"";s:5:"title";s:9:"servicios";s:4:"link";s:0:"";s:9:"image_uri";s:67:"http://localhost/wordpress/wp-content/uploads/2018/12/tiendaa-1.png";s:15:"custom_media_id";s:3:"173";s:19:"image_in_customizer";s:75:"http://localhost/wordpress/wp-content/uploads/2018/12/tiendaa-1-150x150.png";}i:7;a:6:{s:4:"text";s:0:"";s:5:"title";s:13:"tienda online";s:4:"link";s:0:"";s:9:"image_uri";s:67:"http://localhost/wordpress/wp-content/uploads/2018/12/tiendaa-1.png";s:15:"custom_media_id";s:3:"173";s:19:"image_in_customizer";s:75:"http://localhost/wordpress/wp-content/uploads/2018/12/tiendaa-1-150x150.png";}i:8;a:6:{s:4:"text";s:17:"ingresar paquetes";s:5:"title";s:8:"paquetes";s:4:"link";s:0:"";s:9:"image_uri";s:72:"http://localhost/wordpress/wp-content/uploads/2018/12/tienda-300x300.png";s:15:"custom_media_id";s:3:"170";s:19:"image_in_customizer";s:72:"http://localhost/wordpress/wp-content/uploads/2018/12/tienda-150x150.png";}i:9;a:6:{s:4:"text";s:16:"conoce a nuestro";s:5:"title";s:13:"profesionales";s:4:"link";s:0:"";s:9:"image_uri";s:72:"http://localhost/wordpress/wp-content/uploads/2018/12/tienda-300x300.png";s:15:"custom_media_id";s:3:"170";s:19:"image_in_customizer";s:72:"http://localhost/wordpress/wp-content/uploads/2018/12/tienda-150x150.png";}i:11;a:0:{}}', 'yes'),
(1207, 'widget_zerif_testim-widget', 'a:4:{i:1;a:7:{s:5:"title";s:16:"Carla y Mauricio";s:4:"text";s:318:"El matri salió perfecto!!! no puedo imaginar algo mejor!!! Gracias a ustedes por todo el esfuerzo dedicación y cantidad de detalles que hicieron ese día tan especial, gracias a Anderson por todo su apoyo, paciencia, y por hacer que este día sea el mejor día en nuestras vidas... realmente estamos muy agradecidos.";s:9:"image_uri";s:66:"http://localhost/wordpress/wp-content/uploads/2018/12/images-1.jpg";s:7:"details";s:0:"";s:4:"link";s:0:"";s:15:"custom_media_id";s:3:"263";s:19:"image_in_customizer";s:74:"http://localhost/wordpress/wp-content/uploads/2018/12/images-1-150x112.jpg";}i:2;a:7:{s:5:"title";s:13:"Linda Guthrie";s:4:"text";s:392:"Hola quería agradecerles por el servicio brindado en mi matrimonio, en especial por la hora loca, que a todos los invitados les encantó, tanto a mis amigos peruanos como a mis amigos extranjeros...estuvo súper lindo!!! gracias Karla y Sofía por apoyarme ese día, les agradezco bastante... por todos los servicios brindados, y su profesionalismo es incomparable ..!! gracias una vez más.";s:9:"image_uri";s:79:"http://localhost/wordpress/wp-content/themes/zerif-lite/images/testimonial2.jpg";s:7:"details";s:0:"";s:4:"link";s:0:"";s:15:"custom_media_id";s:0:"";s:19:"image_in_customizer";s:0:"";}i:3;a:7:{s:5:"title";s:13:"Cynthia Henry";s:4:"text";s:254:" Súper recomendable, todo desde la decoración hasta la comida, súper riquísima... además que las personas que trabajan ahí son súper profesionales, confiables, respetuosas y muy puntuales. Gracias por hacer de nuestro agazajo un momento sin igual!";s:9:"image_uri";s:79:"http://localhost/wordpress/wp-content/themes/zerif-lite/images/testimonial3.jpg";s:7:"details";s:0:"";s:4:"link";s:0:"";s:15:"custom_media_id";s:0:"";s:19:"image_in_customizer";s:0:"";}s:12:"_multiwidget";i:1;}', 'yes'),
