(371, 1, '2019-01-02 12:47:38', '2019-01-02 17:47:38', '<!-- wp:separator -->\n<hr class="wp-block-separator"/>\n<!-- /wp:separator -->\n\n<!-- wp:metaslider/slider {"slideshowId":484} -->\n[metaslider id=484 cssclass=" alignnormal"]\n<!-- /wp:metaslider/slider -->\n\n<!-- wp:paragraph -->\n<p>Imaginate tus sueños hechos realidad, en Imagina eventos nos encargamos que tu boda sea inolvidable, siendo muy perceptivos con los detalles </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Decoración\ny Ambientación de Local de Recepción</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Decoración del ingreso de local.</li><li>Salón de recepción totalmente decorado a base de telas en color\nperla.</li><li>Decoración de local a base de luces decorativas (cascadas de\nluces).</li><li>Decoración de techo en base a telas.</li><li>Mesa de torta completamente decorada a base de telas y luces\ndecorativas.</li><li>Fondo Principal a base de tela organza, cascada de luces, tachos\nled. </li><li>Decoración de la mesa de novios (implementación de arreglo de\nflores tipo lagarto).</li><li>02 Floreros Decorativos de luz led plateados.</li><li>03 Candelabros de cristal.</li><li>Implementación de detalles para mesa (decoración de botellas de\nvino).</li><li>04 pedestales de flores.</li><li>01 arco de flores para ingreso con campana.</li><li>Centros de mesa de vidrio y base espejo.</li><li>15 Arreglos base de flores naturales para cada mesa (centros de\nmesa).</li><li>Lazos decorativos para sillas.</li><li>12 tachos par led para ambientación.</li><li>Máquina de humo.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>Mantelería</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>15 Sobre manteles o caminos (color de acuerdo a la temática) en\ntela organza con diseño.</li><li>15 manteles base en color blanco, perla o negro (tela polibrillo\ny/o razo).</li><li>150 servilletas de tela decoradas.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>Montaje, mesas y sillas</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>15 Mesas redondas con capacidad para 10 personas cada una.</li><li>Una mesa rectangular para novios.</li><li>Una mesa redonda para torta.</li><li>Implementación de mesa buffet.</li><li>150 Sillas modelo tiffany plateadas.</li><li>04 Salas lounge.</li><li>01 mobiliario de bar.</li><li>01 pista de baile en color blanco con las iniciales de los novios.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>Catering</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Torta de 06 kilos con masa elástica especial para\nboda.<strong></strong><ul><li>1000 bocaditos exhibidos en la mesa de buffet y pasantes\n(elegir de lista de bocaditos)<strong></strong></li></ul></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>Menajería y Cristalería &nbsp;</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>150 puestos de vajilla de loza redonda.<ul><li>150 cubiertos hoteleros (tenedor y cuchillo). </li></ul><ul><li>Copas de vino para 150 personas.</li></ul><ul><li>Copas de champange para 150 personas.</li></ul><ul><li>Vasos de cerveza para 150 personas.</li></ul><ul><li>Vasos de agua para 150 personas.</li></ul><ul><li>Vasos de wisky para 150 personas.</li></ul><ul><li>Jarras plateadas para agua.</li></ul><ul><li>Jarras de cristal para gaseosa y/o cerveza.</li></ul><ul><li>Hieleras de plata.</li></ul><ul><li>Fuentes plateadas.</li></ul><ul><li>Fuentes para buffet de porcelana.</li></ul></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>Bridaga de Servicio </strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Coordinadores de evento.</li><li>Maestro de ceremonia. (Sr. Fernando Estrada)</li><li>06 Mozos debidamente uniformados. </li><li>Un Mayordomo.</li></ul>\n<!-- /wp:list -->', 'Matrimonios', '', 'publish', 'closed', 'closed', '', 'matrimonios', '', '', '2019-01-03 01:48:31', '2019-01-03 06:48:31', '', 0, 'http://localhost/wordpress/?page_id=371', 0, 'page', '', 0);
